searchNodes=[{"doc":"GraphBanking keeps the contexts that define your domain and business logic.Contexts are also responsible for managing your data, regardless if it comes from the database, an external API or others.","ref":"GraphBanking.html","title":"GraphBanking","type":"module"},{"doc":"Module with named helpers generated from GraphBankingWeb.Router.","ref":"GraphBankingWeb.Router.Helpers.html","title":"GraphBankingWeb.Router.Helpers","type":"module"},{"doc":"Generates the path information including any necessary prefix.","ref":"GraphBankingWeb.Router.Helpers.html#path/2","title":"GraphBankingWeb.Router.Helpers.path/2","type":"function"},{"doc":"Generates an integrity hash to a static asset given its file path.","ref":"GraphBankingWeb.Router.Helpers.html#static_integrity/2","title":"GraphBankingWeb.Router.Helpers.static_integrity/2","type":"function"},{"doc":"Generates path to a static asset given its file path.","ref":"GraphBankingWeb.Router.Helpers.html#static_path/2","title":"GraphBankingWeb.Router.Helpers.static_path/2","type":"function"},{"doc":"Generates url to a static asset given its file path.","ref":"GraphBankingWeb.Router.Helpers.html#static_url/2","title":"GraphBankingWeb.Router.Helpers.static_url/2","type":"function"},{"doc":"Generates the connection/endpoint base URL without any path information.","ref":"GraphBankingWeb.Router.Helpers.html#url/1","title":"GraphBankingWeb.Router.Helpers.url/1","type":"function"},{"doc":"ContributingMake sure to have docker-compose installed.","ref":"contributing.html","title":"Contributing","type":"extras"},{"doc":"Enter the development container:git clone https://github.com/felipelincoln/graph-banking.git cd graph-banking/ docker-compose run --service-ports --rm web /bin/shCreate the database, run migrations and start the server:mix ecto.setup mix phx.serverAlternatively (when the database is already created), you can fast start the services:docker-compose up","ref":"contributing.html#running-the-application-locally","title":"Contributing - Running the application locally","type":"extras"},{"doc":"Good practice to run before making commits. It will mirror our GitHub action.Run the following inside the container:mix ciThis will run:mix format --check-formatted --dry-run mix credo --strict mix coveralls","ref":"contributing.html#test-pipeline","title":"Contributing - Test pipeline","type":"extras"},{"doc":"Run whenever your changes may cause documentation changes.Run the following inside the container:mix docs","ref":"contributing.html#building-documentation","title":"Contributing - Building documentation","type":"extras"}]